import { Container } from 'react-bootstrap';
import {Row} from 'react-bootstrap';
import {Col} from 'react-bootstrap';
import './App.css';

function App() {
  return (
    <div className="App">
      <Container>
        <Row >
          <Col xs={3}></Col>
          <Col xs={6}>
            <p>Faraz's Calculator</p>
          </Col>
          <Col xs={3}></Col>
        </Row>
      </Container>

    </div>
  );
}

export default App;
